import img1 from "../assets/aa.jpg"

const DUMMY_PROFILES = [
  { id: 1, name: 'Sophia', role: 'Model', location: 'Paris', price: 300, img: img1 },
  { id: 2, name: 'Isabella', role: 'Dancer', location: 'Madrid', price: 350, img: img2 },
  { id: 3, name: 'Emma', role: 'Student', location: 'Berlin', price: 250, img: 'https://img.freepik.com/free-photo/elephant-artificial-intelligence-image_23-2150404852.jpg' },
  { id: 4, name: 'Olivia', role: 'Actress', location: 'Milan', price: 400, img: 'https://img.freepik.com/free-photo/elephant-artificial-intelligence-image_23-2150404852.jpg' }
];

export default DUMMY_PROFILES;
